import React, { useState } from "react";
import { NavLink } from "react-router-dom";
// import { NavLink } from "react-router-dom";
const Navbar = () => {
    let date = new Date().toLocaleDateString();


    let time = new Date().toLocaleTimeString();
    const [ctime, setCtime] = useState(time);

    const UpdateTime = () => {
        time = new Date().toLocaleTimeString();
        setCtime(time);
    }
    setInterval(UpdateTime, 1000);
    return (
        <div>
            <nav className="navbar mainnav navbar-expand-lg navbar-light bg-light sticky-top">
                <div className="container-fluid">
                    <div className="collapse navbar-collapse" id="navbarSupportedContent">
                        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
                            <li className="nav-item">
                                <NavLink className="nav-link me-3" to="/">Dashboard</NavLink>
                            </li>
                            <li className="nav-item">
                                <NavLink className="nav-link" to="/">{date} <span className="ms-2">{ctime}</span></NavLink>
                            </li>

                        </ul>
                    </div>
                </div>
            </nav>
            <nav className="card rounded-0 text-center fixed-top mobilenav pe-3">
                <div className="row">
                    <div className="mobile_btn flex-fill">
                        <NavLink className="sidemenu btn  btn-link  waves-effect waves-light"
                         onclick="openNav()">
                            <i className="fa fa-bars fa-2x"></i>
                        </NavLink>
                        <div id="mySidenav" className="sidenav text-center">
                            <NavLink  className="closebtn" onclick="closeNav()">&times;</NavLink>
                            <ul className="navbar-nav mx-auto w-100" id="menu_show">
                                <li className="nav-item flex-fill @yield('home')">
                                    <a className="nav-link" href="{{ route('frontend.index') }}"><i
                                        className="fa fa-home"></i></a>
                                </li>




                            </ul>
                        </div>

                    </div>

                </div>
            </nav>
        </div>


    )
}

export default Navbar;
